using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// An attachment behavior specifies a dynamic connection between two dynamic items, or between a dynamic item and an anchor point. By default, an itemâ€™s attachment point is at its center, but you can change that.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIAttachmentBehavior_Class/index.html#//apple_ref/occ/cl/UIAttachmentBehavior"/>    [iOSVersion(7)]    [Export("")]    public class UIAttachmentBehavior : UIDynamicBehavior//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public UIAttachmentBehavior() { }        /// <summary>        /// The dynamic items connected by the attachment behavior. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("items")]        public AnyObject[] Items { get; private set; }                /// <summary>        /// The anchor point for an attachment behavior of type UIAttachmentBehaviorTypeAnchor.        /// </summary>        [iOSVersion(7)]        [Export("anchorPoint")]        public CGPoint AnchorPoint { get; set; }                /// <summary>        /// The type of the attachment behavior. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("attachedBehaviorType")]        public UIAttachmentBehaviorType AttachedBehaviorType { get; private set; }                /// <summary>        /// The amount of damping to apply to the attachment behavior.        /// </summary>        [iOSVersion(7)]        [Export("damping")]        public CGFloat Damping { get; set; }                /// <summary>        /// The frequency of oscillation for the attachment behavior.        /// </summary>        [iOSVersion(7)]        [Export("frequency")]        public CGFloat Frequency { get; set; }                /// <summary>        /// The distance, in points, between the two attachment points of the attachment behavior.        /// </summary>        [iOSVersion(7)]        [Export("length")]        public CGFloat Length { get; set; }    }    /// <summary>    /// The type of an attachment behavior, indicating what a dynamic item is attached to.    /// </summary>    public enum UIAttachmentBehaviorType    {        /// <summary>        /// Designates an attachment behavior that connects a dynamic item to another dynamic item.        /// </summary>        [iOSVersion(7)]        Items,        /// <summary>        /// Designates an attachment behavior that connects a dynamic item to an anchor point.        /// </summary>        [iOSVersion(7)]        Anchor,    }}